import React from 'react';

const PlansPage = () => {
  return (
    <div className="min-h-screen bg-gray-50 flex items-center justify-center">
      <div className="text-center animate-fade-in-up">
        <h1 className="text-3xl font-bold text-gray-900 mb-4 animate-text-glow">My Plans</h1>
        <p className="text-gray-600 animate-pulse-slow">Plans page coming soon...</p>
      </div>
    </div>
  );
};

export default PlansPage;
